import React from 'react';
import ReactDOM from 'react-dom';
import { Track } from './../Track/track.js'
import './trackList.css';

export class TrackList extends React.Component {
  render() {
    return (
      <div className="TrackList">
        {this.props.tracks.map(
                    track => {
                        return (
                            <Track
                            key={track.id}
                            track={track} />
                        );
                    }
                )}
      </div>
    );
  }
}
